import React from 'react'
import { Doughnut } from 'react-chartjs-2'

const data = {
  labels: ['Total', 'Admins', 'Users', 'New'],
  datasets: [
    {
      label: '# of Votes',
      data: [12, 19, 3, 6],
      backgroundColor: [
        'rgba(50, 150, 150, 1)',
        'rgba(54, 162, 235, 1)',
        'rgba(255, 206, 86, 1)',
        'rgba(75, 192, 192, 1)',
        'rgba(153, 102, 255, 1)',
        'rgba(255, 159, 64, 1)',
      ],
      borderColor: [
        'rgba(255, 99, 132, 1)',
        'rgba(54, 162, 235, 1)',
        'rgba(255, 206, 86, 1)',
        'rgba(75, 192, 192, 1)',
        'rgba(153, 102, 255, 1)',
        'rgba(255, 159, 64, 1)',
      ],
      borderWidth: 1,
    },
  ],
}

const UsersChart = () => {
  return(
  <>
      <div className='header'>
          <h1 className='title'>Users</h1>
      </div>
      <Doughnut data={data} />
  </>
)
}

export default UsersChart


